<strong>cl-subsetp</strong> is an autoloaded compiled Lisp function in `<code>cl-seq.el</code>'.<br/>
<br/>
(cl-subsetp LIST1 LIST2 [KEYWORD VALUE]...)<br/>
<br/>
Return true if LIST1 is a subset of LIST2.<br/>
I.e., if every element of LIST1 also appears in LIST2.<br/>
<br/>
Keywords supported:  :test :test-not :key
